import Img from './MyPhoto.jpg';
import "./home.css";

const Home = ()=>{
    return(
        <div className="home">
            <p>
                <h2>Hello,</h2> <br/>
                Shivaprasad C S, here !! <br />
                <span style={{fontSize : "0.5em", marginTop: "1em"}}>final year B.Tech at VIT, Vellore</span>
            </p>
            <div className="Img">
                <img src={Img} alt="" />
            </div>
        </div>
    );
}

export default Home;
